import React, { useState, useEffect, useCallback } from 'react';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider, useAuth } from './contexts/AuthContext';
import './App.css';
import Dashboard from './components/Dashboard';
import Header from './components/Header';
import Login from './pages/Login';
import Register from './pages/Register';
import Settings from './components/Settings';
import AuditLogViewer from './components/AuditLogViewer';
import NotificationsPanel from './components/NotificationsPanel';
import AlertBanner from './components/AlertBanner';
import { connectWebSocket, disconnectWebSocket } from './services/websocket';

function ProtectedRoute({ children }) {
  const { isAuthenticated, loading } = useAuth();
  
  if (loading) {
    return (
      <div className="loading">
        <div className="spinner"></div>
        <p>Loading...</p>
      </div>
    );
  }
  
  return isAuthenticated ? children : <Navigate to="/login" />;
}

function MainApp() {
  const [workloadData, setWorkloadData] = useState(null);
  const [isConnected, setIsConnected] = useState(false);
  const [error, setError] = useState(null);
  const [notifications, setNotifications] = useState([]);
  const [showNotifications, setShowNotifications] = useState(false);
  const [currentAlert, setCurrentAlert] = useState(null);
  const { isAuthenticated } = useAuth();

  useEffect(() => {
    if (!isAuthenticated) return;

    // Connect to WebSocket for real-time updates
    const handleMessage = (data) => {
      // Handle different message types
      if (data.type === 'workload_update') {
        setWorkloadData(data.data);
        setIsConnected(true);
        setError(null);
      } else if (data.type === 'notification') {
        // Add new notification
        setNotifications(prev => [data.data, ...prev]);
        // Show alert banner
        setCurrentAlert({
          title: data.data.title,
          message: data.data.message,
          severity: data.data.severity || 'info'
        });
      } else {
        // Legacy format
        setWorkloadData(data);
        setIsConnected(true);
        setError(null);
      }
    };

    const handleError = (err) => {
      setError(err.message || 'Connection error');
      setIsConnected(false);
    };

    const handleClose = () => {
      setIsConnected(false);
    };

    connectWebSocket(handleMessage, handleError, handleClose);

    // Also fetch initial data via REST API
    fetch('/api/workload')
      .then(res => res.json())
      .then(data => {
        setWorkloadData(data);
        setIsConnected(true);
      })
      .catch(err => {
        setError('Failed to fetch initial data: ' + err.message);
      });

    return () => {
      disconnectWebSocket();
    };
  }, [isAuthenticated]);

  return (
    <div className="App">
      <Header 
        isConnected={isConnected} 
        onNotificationsClick={() => setShowNotifications(true)}
        notificationCount={notifications.filter(n => !n.is_read).length}
      />
      {currentAlert && (
        <AlertBanner 
          alert={currentAlert} 
          onDismiss={() => setCurrentAlert(null)} 
        />
      )}
      {error && (
        <div className="error-banner">
          <span>⚠️ {error}</span>
          <button onClick={() => window.location.reload()}>Retry</button>
        </div>
      )}
      <main className="main-content">
        <Routes>
          <Route 
            path="/dashboard" 
            element={
              <ProtectedRoute>
                {workloadData ? (
                  <Dashboard workloadData={workloadData} />
                ) : (
                  <div className="loading">
                    <div className="spinner"></div>
                    <p>Connecting to SAN I/O Monitor...</p>
                  </div>
                )}
              </ProtectedRoute>
            } 
          />
          <Route 
            path="/settings" 
            element={
              <ProtectedRoute>
                <Settings />
              </ProtectedRoute>
            } 
          />
          <Route 
            path="/audit" 
            element={
              <ProtectedRoute>
                <AuditLogViewer />
              </ProtectedRoute>
            } 
          />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/" element={<Navigate to="/dashboard" />} />
        </Routes>
      </main>
      {showNotifications && (
        <NotificationsPanel onClose={() => setShowNotifications(false)} />
      )}
    </div>
  );
}

function App() {
  return (
    <BrowserRouter>
      <AuthProvider>
        <MainApp />
      </AuthProvider>
    </BrowserRouter>
  );
}

export default App;
